Lisa Ann, Allie Haze, Lily Labeau, Holly Michaels, Samantha Saint, Tommy Gunn, Ryan McLane, Angelica Saige, Richie Calhoun


Sequel to AVN's best comedy of the year!

When these couples arrive at the address for a retreat and spa, they're shocked to discover just an average house. Once inside the comedic camp counselor convinces the couples that the benefits of the camp outweigh the less than &quot;spa like&quot; surroundings. One by one the couples are counseled and much to everyone's surprise...the magic works! Their love alone with their sex lives is rekindled!
